import React, { Component } from 'react';
import YouTubeEmbed from '../../components/youtube-embed/YouTubeEmbed';
import PopCheckboxes from '../../components/check-box/PopCheckboxes';
// import PopCardList from '../../components/collection-card/PopCardList';
import { popinfo } from './popinfo';
import './PopYoutubePageStyles.scss';

import { connect } from 'react-redux';


const mapStateToProps = (state) => {
	return {
		pCheckStatus: state.pcheckboxes.pCheckStatus
	}
}


class PopYTpage extends Component {
	render() {
		return(
			<div>
				<div className='youtube_container'>
					<YouTubeEmbed />
				</div>
				<div className='ckeckbox_container'>
					<PopCheckboxes />
				</div>
			</div>
		);
	}
}


export default connect(mapStateToProps)(PopYTpage);





